import{_ as o,c as t,o as e,a2 as n}from"./chunks/framework.CBy9I1-v.js";const m=JSON.parse('{"title":"Submitting a Collection","description":"","frontmatter":{},"headers":[],"relativePath":"collection-submission.md","filePath":"collection-submission.md"}'),i={name:"collection-submission.md"},l=n('<h1 id="submitting-a-collection" tabindex="-1">Submitting a Collection <a class="header-anchor" href="#submitting-a-collection" aria-label="Permalink to &quot;Submitting a Collection&quot;">​</a></h1><p>Submitting a collection of compounds to the COCONUT platform is a two-step process:</p><ol><li><strong>Creation of a Collection</strong></li><li><strong>Uploading Compounds into the Created Collection</strong></li></ol><h2 id="step-1-creation-of-a-collection" tabindex="-1">Step 1: Creation of a Collection <a class="header-anchor" href="#step-1-creation-of-a-collection" aria-label="Permalink to &quot;Step 1: Creation of a Collection&quot;">​</a></h2><p>Before uploading a compound collection onto the COCONUT platform, you need to create a collection.</p><ol><li><strong>Login to your COCONUT account.</strong></li><li><strong>Navigate to the Collections Section:</strong><ul><li>On the left pane, select <strong>&quot;Collections.&quot;</strong></li></ul></li><li><strong>Create a New Collection:</strong><ul><li>Inside the Collections page, click the <strong>&quot;New Collection&quot;</strong> button at the top right.</li></ul></li><li><strong>Fill the &quot;Create Collection&quot; Form:</strong><ul><li><strong>Title:</strong> Provide a title for the collection.</li><li><strong>Slug:</strong> Auto-generated by the COCONUT platform. No need to fill this field.</li><li><strong>Description:</strong> Provide a description of this collection of compounds.</li><li><strong>URL:</strong> If the collection is from a source available online, provide the URL <em>(for reference for our Curators, this does not import the compounds onto COCONUT).</em></li><li><strong>Tags:</strong> Enter comma-separated keywords to identify this collection during searches.</li><li><strong>Identifier:</strong> Provide a unique identifier for the collection.</li><li><strong>License:</strong> Choose a license from the dropdown menu.</li></ul></li><li><strong>Submit the Form:</strong><ul><li>Click <strong>&quot;Create&quot;</strong> to create the collection or <strong>&quot;Create &amp; create another&quot;</strong> if you have another collection to submit.</li></ul></li></ol><p>This creates an empty collection. To upload molecules/compounds, proceed with the steps below.</p><h2 id="step-2-uploading-compounds-into-the-created-collection" tabindex="-1">Step 2: Uploading Compounds into the Created Collection <a class="header-anchor" href="#step-2-uploading-compounds-into-the-created-collection" aria-label="Permalink to &quot;Step 2: Uploading Compounds into the Created Collection&quot;">​</a></h2><p>After creating an empty collection, an <strong>&quot;Entries&quot;</strong> pane becomes available at the bottom.</p><ol><li><p><strong>Initiate the Import Process:</strong></p><ul><li>Click on <strong>&quot;Import Entries&quot;</strong> on the left of the &quot;Entries&quot; pane.</li></ul></li><li><p><strong>Download the Template:</strong></p><ul><li>In the pop-up window, download the template CSV file, which specifies the fields expected by COCONUT in a comma-separated format. Provide the following details for each molecule: <ul><li><strong>canonical_smiles:</strong> Canonical SMILES notation of the chemical structure.</li><li><strong>reference_id:</strong> Reference ID as reported in a source database/dataset.</li><li><strong>name:</strong> IUPAC name/trivial name as reported in the original publication or source. <blockquote><p><strong>Example:</strong> [9-fluoro-11-hydroxy-17-(2-hydroxyacetyl)-10,13,16-trimethyl-3-oxo-6,7,8,11,12,14,15,16-octahydrocyclopenta[a]phenanthren-17-yl] pentanoate</p></blockquote></li><li><strong>doi:</strong> DOI of the original publication where the molecule is first reported. <blockquote><p><strong>Example:</strong> doi.org/10.1021/ci5003697</p></blockquote></li><li><strong>link:</strong> Database link of the molecule.</li><li><strong>organism:</strong> Scientific name of the organism in which the compound is found. <blockquote><p><strong>Example:</strong> Tanacetum parthenium</p></blockquote></li><li><strong>organism_part:</strong> The part of the organism in which the compound is found. <blockquote><p><strong>Example:</strong> Eyes</p></blockquote></li><li><strong>COCONUT_id:</strong> Auto-generated by the COCONUT platform. No need to fill this field.</li><li><strong>mol_filename:</strong> If a 2D/3D molfile is present for the given molecule, mention its name.</li><li><strong>structural_comments:</strong> Comments regarding the structure, if any.</li><li><strong>geo_location:</strong> Geographical location where this molecule is found. <blockquote><p><strong>Example:</strong> Rajahmundry, India</p></blockquote></li><li><strong>location:</strong> Specific location within the geographical area where the molecule is found. <blockquote><p><strong>Example:</strong> Air, Water, Soil, etc.</p></blockquote></li></ul></li></ul></li><li><p><strong>Upload the CSV File:</strong></p><ul><li>In the same pop-up window from step 2, click <strong>&quot;Upload the CSV&quot;</strong> file with all the details of the compounds. Choose the file.</li></ul></li><li><p><strong>Verify Column Mapping:</strong></p><ul><li>The pop-up window will show expected columns on the right and detected columns from the CSV file on the left. Ensure the mapping is correct. Use the dropdowns for any corrections and click <strong>&quot;Import.&quot;</strong></li></ul><blockquote><p><strong>Tip:</strong> If you have already uploaded the CSV file before and made changes to the details of molecules in the CSV file and want to upload the modified CSV file, you need to choose <strong>&quot;Update existing records&quot;</strong> so that the respective molecules will get updated with the new data provided.</p></blockquote></li><li><p><strong>Start the Import Process:</strong></p><ul><li>You should see an <strong>&quot;Import started&quot;</strong> notification at the top left.</li></ul><blockquote><p><strong>Note for Local Development:</strong> Start Laravel Horizon to process the queued compounds:</p></blockquote><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">sail</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> artisan</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> horizon</span></span></code></pre></div></li><li><p><strong>Check the Import Status:</strong></p><ul><li>Once the processing completes, you should see the compounds listed along with their status <strong>&quot;SUBMITTED.&quot;</strong></li></ul><blockquote><p><strong>Warning:</strong> For statuses other than <strong>&quot;SUBMITTED,&quot;</strong> recheck the corresponding compound&#39;s details in the CSV and re-upload it, repeating step 4.</p></blockquote></li><li><p><strong>Process the Compounds:</strong></p><ul><li>Even if one compound in the uploaded list has the status <strong>&quot;SUBMITTED,&quot;</strong> you will see the <strong>&quot;Process&quot;</strong> button along with the <strong>&quot;Import entries&quot;</strong> button. Click this to process the submitted compounds.</li></ul></li><li><p><strong>Complete the Processing:</strong></p><ul><li>Wait for the processing to finish. The status updates to <strong>&quot;PASSED&quot;</strong> for successfully processed entries and <strong>&quot;REJECTED&quot;</strong> for those that failed processing. <ul><li>For successfully processed compounds, check the <strong>&quot;Citations&quot;</strong> and <strong>&quot;Molecules&quot;</strong> tabs to ensure everything is properly processed.</li><li>The <strong>&quot;Audits&quot;</strong> tab will have a trail of who did what and when on the Collection.</li></ul><blockquote><p><strong>Warning:</strong> For failed entries, recheck the corresponding compound&#39;s details in the CSV and re-upload it, repeating step 4.</p></blockquote></li></ul></li><li><p><strong>Publish the Compounds:</strong></p><ul><li>If at least one compound passed the process, you will see the <strong>&quot;Publish&quot;</strong> button. Clicking this will publish the compounds that passed processing.</li></ul><blockquote><p><strong>Info:</strong> After publishing, the collection status changes from <strong>&quot;DRAFT&quot;</strong> to <strong>&quot;PUBLISHED.&quot;</strong> Only the compounds with status <strong>&quot;PASSED&quot;</strong> will be visible to everyone on the COCONUT platform.</p></blockquote></li></ol>',10),s=[l];function r(a,c,u,p,g,h){return e(),t("div",null,s)}const f=o(i,[["render",r]]);export{m as __pageData,f as default};
